// âœ… Import Firebase
import { initializeApp } from "https://www.gstatic.com/firebasejs/10.13.0/firebase-app.js";
import { getAuth, onAuthStateChanged, signOut } from "https://www.gstatic.com/firebasejs/10.13.0/firebase-auth.js";
import { getFirestore, collection, addDoc, serverTimestamp, getDoc, doc } from "https://www.gstatic.com/firebasejs/10.13.0/firebase-firestore.js";
import { firebaseConfig } from "../../../../configFirebase.js";

const app = initializeApp(firebaseConfig);
const auth = getAuth(app);
const db = getFirestore(app);

// ðŸ”‘ Controllo autenticazione
onAuthStateChanged(auth, (user) => {
  if (!user) {
    window.location.href = "/login";
  }
});

// ðŸšª Logout
const logoutBtn = document.getElementById("logoutBtn");
logoutBtn.addEventListener("click", async () => {
  await signOut(auth);
  window.location.href = "/login";
});

// ðŸ“„ Form
const expulsionForm = document.getElementById("expulsionReportForm");
const statusMsg = document.getElementById("statusMsg");
const LOGO_BASE64 = "data:image/png;base64,"

expulsionForm.addEventListener("submit", async (e) => {
  e.preventDefault();

  const userName = document.getElementById("userSelect").value.trim();
  const userNumber = document.getElementById("userNumber").value.trim();
  const reason = document.getElementById("reason").value.trim();
  const expulsionDate = document.getElementById("expulsionDate").value;
  const notes = document.getElementById("notes").value.trim();

  if (!userName || !reason || !expulsionDate) {
    statusMsg.textContent = "âŒ Compila tutti i campi obbligatori!";
    statusMsg.className = "error";
    return;
  }

  try {
    // Salvataggio Firestore
    await addDoc(collection(db, "expulsionReports"), {
      userName,
      userNumber,
      staffMail: auth.currentUser.email,
      reason,
      expulsionDate,
      notes,
      reportedBy: auth.currentUser.uid,
      createdAt: serverTimestamp()
    });

    await addDoc(collection(db, "activities"), {
      type: "kick_add",
      addStaffer: auth.currentUser.email,
      kickedMember: userName,
      timestamp: serverTimestamp()
    });

    statusMsg.textContent = "âœ… Report inviato con successo!";
    statusMsg.className = "success";
    expulsionForm.reset();

    // Recupera nome staff
    const staffDoc = await getDoc(doc(db, "users", auth.currentUser.uid));
    const staffName = staffDoc.exists() ? staffDoc.data().name : "Staff non disponibile";

    // ðŸ”¹ Genera PDF
    generatePDF({
      userName,
      userNumber,
      reason,
      expulsionDate,
      notes,
      staffName
    });

  } catch (err) {
    console.error("Errore invio report:", err);
    statusMsg.textContent = "âŒ Errore nell'invio del report. Riprovare.";
    statusMsg.className = "error";
  }
});

// =====================
// Genera PDF stile C
// =====================
function generatePDF(data) {
  const { jsPDF } = window.jspdf;
  const doc = new jsPDF();

  // Logo
  const logoUrl = LOGO_BASE64;
  const img = new Image();
  img.src = logoUrl;
  img.onload = () => {
    doc.addImage(img, "PNG", 80, 10, 50, 50);

    // Titolo
    doc.setFontSize(18);
    doc.setFont("helvetica", "bold");
    doc.text("REPORT DI ESPULSIONE", 105, 70, { align: "center" });

    // Intestazione
    doc.setFontSize(12);
    doc.setFont("helvetica", "normal");
    doc.text(`Data: ${new Date().toLocaleDateString()}`, 14, 85);
    doc.text(`Generato da: ${data.staffName}`, 14, 92);

    // Tabella dati principali
    let startY = 105;
    doc.setFont("helvetica", "bold");
    doc.text("Utente Espulso:", 14, startY);
    doc.setFont("helvetica", "normal");
    doc.text(data.userName, 60, startY);

    startY += 10;
    doc.setFont("helvetica", "bold");
    doc.text("Numero Contatto:", 14, startY);
    doc.setFont("helvetica", "normal");
    doc.text(data.userNumber || "-", 60, startY);

    startY += 10;
    doc.setFont("helvetica", "bold");
    doc.text("Data Espulsione:", 14, startY);
    doc.setFont("helvetica", "normal");
    doc.text(data.expulsionDate, 60, startY);

    startY += 15;
    doc.setFont("helvetica", "bold");
    doc.text("Motivo:", 14, startY);
    doc.setFont("helvetica", "normal");
    doc.text(doc.splitTextToSize(data.reason, 180), 14, startY + 6);

    startY += 70;
    doc.setFont("helvetica", "bold");
    doc.text("Note aggiuntive:", 14, startY);
    doc.setFont("helvetica", "normal");
    doc.text(doc.splitTextToSize(data.notes || "-", 180), 14, startY + 6);

    // Footer
    doc.setFontSize(10);
    doc.setTextColor("#555");
    doc.text("Friuli Emergenze - MyFrEM Staff", 105, 280, { align: "center" });

    // Scarica PDF
    doc.save(`Report_Espulsione_${data.userName}.pdf`);
  };
}